export default function getMileageCharges({clientDistance:e,mileageCharges:t}){let r=0,a=!1;if(Array.isArray(t))for(const{range:s,cost:n}of t){const[t,i]=s.split("-"),c=parseInt(t,10),o=i.includes("+")?parseInt(i.replace("+",""),10):parseInt(i,10);if(i.includes("+")&&e>=c){r=n,a=!0;break}if(e>=c&&e<=o){r=n,a=!0;break}}else{if(!t)return{inRange:!1,cost:0};const{cost_per_mile:s,starting_mile:n,base_cost:i}=t,c=parseFloat(s),o=parseInt(n,10),l=parseInt(e,10),p=parseInt(i,10)||0;l>=o&&(r=Math.round((l-o)*c+p),a=!0)}return{inRange:a,cost:r}}